import React, { useEffect } from 'react'
import { useUsers } from '../../Context/UsuariosContexto'

function VerUsuarios() {

    const {getUsuarios} = useUsers()

    useEffect(()=>{
        getUsuarios()
    }, [])

  return (
<div>VerUsuarios</div>
  )
}

export default VerUsuarios
